<!doctype html><html><head><meta charset="utf-8"/><title>Webpack App</title><script defer="defer" src="stars.bundle.js"></script><script defer="defer" src="boids.bundle.js"></script></head><body><a href="index.html">home</a><div id="contentWindow"></div></body><script>if ("serviceWorker" in navigator) {
            window.addEventListener("load", () => {
                navigator.serviceWorker
                    .register("service-worker.js")
                    .then((registration) => {
                        console.log("Service Worker registered: ", registration);
                    })
                    .catch((registrationError) => {
                        console.error("Service Worker registration failed: ", registrationError);
                    });
            });
        }</script></html>
